### [♠](#1) <span id='1'>Json简介</span>

>JSON(JavaScript Object Notation) 是一种轻量级的数据交换格式。易于人阅读和编写。同时也易于机器解析和生成。 它基于JavaScript Programming Language, Standard ECMA-262 3rd Edition - December 1999的一个子集。 JSON采用完全独立于语言的文本格式，但是也使用了类似于C语言家族的习惯（包括C, C++, C#, Java, JavaScript, Perl, Python等）。这些特性使JSON成为理想的数据交换语言。

>JSON建构于两种结构：

>- “名称/值”对的集合（A collection of name/value pairs）。不同的语言中，它被理解为对象（object），纪录（record），结构（struct），字典（dictionary），哈希表（hash table），有键列表（keyed list），或者关联数组 （associative array）。
>- 值的有序列表（An ordered list of values）。在大部分语言中，它被理解为数组（array）。

### [♠](#2) <span id='2'>Json.NET(Newtonsoft.Json)</span>

[Json.NET](https://www.newtonsoft.com/json)是.Net最受欢迎的JSON开源框架之一。

- Dll：[Newtonsoft.Json.dll](https://github.com/JamesNK/Newtonsoft.Json/releases)
- NuGet：`PM> Install-Package Newtonsoft.Json`

### [♠](#3) <span id='3'>序列化和反序列化</span>
``` Types
public class Account
{
    public string Email { get; set; }
    public bool Active { get; set; }
    public DateTime CreatedDate { get; set; }
    public IList<string> Roles { get; set; }
}
```
#### [♠](#31) <span id='31'>序列化</span>

```Usage
Account account = new Account
{
    Email = "james@example.com",
    Active = true,
    CreatedDate = new DateTime(2013, 1, 20, 0, 0, 0, DateTimeKind.Utc),
    Roles = new List<string>
    {
        "User",
        "Admin"
    }
};

string json = JsonConvert.SerializeObject(account);
// {
//   "Email": "james@example.com",
//   "Active": true,
//   "CreatedDate": "2013-01-20T00:00:00Z",
//   "Roles": [
//     "User",
//     "Admin"
//   ]
// }

Console.WriteLine(json);
```
#### [♠](#32) <span id='32'>反序列化</span>

```Usage
string json = @"{
  'Email': 'james@example.com',
  'Active': true,
  'CreatedDate': '2013-01-20T00:00:00Z',
  'Roles': [
    'User',
    'Admin'
  ]
}";

Account account = JsonConvert.DeserializeObject<Account>(json);

Console.WriteLine(account.Email);
// james@example.com
```
